(1760, 1, '2018-01-24 15:15:51', '2018-01-24 23:15:51', 'This is my First IMG-208 Communication & Design 2 Project. The assignment was to make an info graphic and I decided to try making one with no body text as a sort of challenge to myself.\r\n\r\nThe purpose of this fishing poster is to inform any aspiring fisherman of what the basics involve.\r\n\r\nAll Raster Images are not mine, they were used attained from Google search and so I don\'t own any rights to them. ', 'infographic_export', 'IMG-208 Communication & Design 2 Infographic', 'inherit', 'open', 'closed', '', 'infographic_export', '', '', '2018-03-22 16:28:33', '2018-03-22 23:28:33', '', 0, 'http://localhost/wp-content/uploads/2018/01/infographic_export.png', 0, 'attachment', 'image/png', 0),
(1761, 1, '2018-01-24 15:37:11', '2018-01-24 23:37:11', 'This is my First IMG-208 Communication &amp; Design 2 Project. The assignment was to make an info graphic and I decided to try making one with no body text as a sort of challenge to myself.\r\n\r\nThe purpose of this fishing poster is to inform any aspiring fisherman of what the basics necessities involved.\r\n\r\n<em>All Raster Images, fish icon, and fish in the water are not mine, they were attained from Google search so I don\'t own any rights to them.</em>\r\n\r\n<img class=\"wp-image-1760 aligncenter\" src=\"http://localhost/wp-content/uploads/2018/01/infographic_export.png\" alt=\"\" width=\"800\" height=\"1726\" />\r\n\r\n&nbsp;\r\n\r\nIf your Interested in this projects details here\'s a page with said information.\r\n\r\n<strong><a class=\"row-title\" href=\"http://localhost/amateur-anglers-details-page/\" aria-label=\"“Amateur Anglers Details Page” (Edit)\">Amateur Anglers Details Page</a></strong>', 'IMG-208 Project 1: Infographic', '', 'publish', 'open', 'open', '', 'amateur-anglers-infographic', '', '', '2018-03-01 18:44:23', '2018-03-02 02:44:23', '', 0, 'http://localhost/?p=1761', 0, 'post', '', 0),
