(1763, 1, '2018-01-24 15:56:06', '2018-01-24 23:56:06', '<h2>Project Summary</h2>\r\n<ul>\r\n 	<li>Come up with an idea you want to express visually</li>\r\n 	<li>Use one or more of the following media: text, photos, maps, line art, graphic elements.</li>\r\n 	<li>Produce your chosen design in Illustrator.</li>\r\n 	<li>The information in your infographic MUST be accurate</li>\r\n 	<li>Size is at your discretion</li>\r\n</ul>\r\n<h4></h4>\r\n<h3>The Work Involved</h3>\r\n<h5 style=\"text-align: center;\">Mood Board</h5>\r\n<img class=\"wp-image-1769 size-large aligncenter\" src=\"http://localhost/wp-content/uploads/2018/01/Craig-Mood-Board-assign-1-1024x655.png\" alt=\"\" width=\"640\" height=\"409\" />\r\n<h5></h5>\r\n<h5 style=\"text-align: center;\">Research</h5>\r\n<img class=\"alignnone size-medium wp-image-1770\" src=\"http://localhost/wp-content/uploads/2018/01/44d0f3058634ec9f3f8131a4a333fdaa-300x264.jpg\" alt=\"\" width=\"300\" height=\"264\" /> <img class=\"alignnone size-medium wp-image-1771\" src=\"http://localhost/wp-content/uploads/2018/01/caught-on-the-fly_5154867b7d084-187x300.png\" alt=\"\" width=\"187\" height=\"300\" /> <img class=\"alignnone size-medium wp-image-1772\" src=\"http://localhost/wp-content/uploads/2018/01/infographic-fishing-poster-template-night-black-colors-icons-flyer-vector-illustration-42988260-246x300.jpg\" alt=\"\" width=\"246\" height=\"300\" /> <img class=\"alignnone size-medium wp-image-1773\" src=\"http://localhost/wp-content/uploads/2018/01/stock-vector-fishing-infographic-elements-set-elements-for-creating-your-own-infographic-design-vector-264470642-281x300.jpg\" alt=\"\" width=\"281\" height=\"300\" />\r\n<h5></h5>\r\n<h5 style=\"text-align: center;\">Early Concept</h5>\r\n<img class=\"wp-image-1774 size-large aligncenter\" src=\"http://localhost/wp-content/uploads/2018/01/Craig-assign-1-infographic-Rough-1024x929.png\" alt=\"\" width=\"640\" height=\"581\" />\r\n\r\n&nbsp;\r\n<h5 style=\"text-align: center;\">Rough Drafts</h5>\r\n<img class=\"wp-image-1777 size-large aligncenter\" src=\"http://localhost/wp-content/uploads/2018/01/Rough2-663x1024.png\" alt=\"\" width=\"640\" height=\"988\" /> <img class=\"aligncenter wp-image-1778 size-large\" src=\"http://localhost/wp-content/uploads/2018/01/Rough3-841x1024.png\" alt=\"\" width=\"640\" height=\"779\" /> <img class=\"aligncenter wp-image-1776 size-large\" src=\"http://localhost/wp-content/uploads/2018/01/Rough1-663x1024.png\" alt=\"\" width=\"640\" height=\"988\" />\r\n<h4></h4>\r\n<h3>About Infographics</h3>\r\n<h5>When to Use an Infographic</h5>\r\n<ul>\r\n 	<li>When detailed explanations are bogging down the text</li>\r\n 	<li>When space is limited and a small list or graphic may explain more in less space</li>\r\n 	<li>When a graphical explanation clarifies key concepts</li>\r\n 	<li>When language or literacy is an issue</li>\r\n 	<li>When you need to convey complex information quickly</li>\r\n</ul>\r\n<h5>Creating Accurate Infographics</h5>\r\n<ul>\r\n 	<li>Do your research! Collect data carefully</li>\r\n 	<li>Edit information carefully. Limited space may lead to fact errors or misleading statements</li>\r\n 	<li>Convert to standard values. (metric imperial conversions)</li>\r\n 	<li>Keep it simple. Less is more, and clearer.</li>\r\n</ul>\r\n<h5>Creating Good Infographics</h5>\r\n<ul>\r\n 	<li>Keep it simple. A single, clear message is easier to comprehend than an image with multiple components</li>\r\n 	<li>Dress it up. Use graphic elements instead of bars for charts, for example. Position an infographic as you would a photograph</li>\r\n</ul>', 'Amateur Anglers Details Page', '', 'publish', 'closed', 'closed', '', 'amateur-anglers-details-page', '', '', '2018-02-01 11:18:50', '2018-02-01 19:18:50', '', 0, 'http://localhost/?page_id=1763', 0, 'page', '', 0),
