(1765, 1, '2018-01-24 16:19:30', '2018-01-25 00:19:30', '<h4>Project Summary</h4>\n<h5>Infographic Assignment</h5>\n<ul>\n 	<li>Come up with an idea you want to express visually</li>\n 	<li>Use one or more of the following media: text, photos, maps, line art, graphic elements.</li>\n 	<li>Produce your chosen design in Illustrator.</li>\n 	<li>The information in your infographic MUST be accurate</li>\n 	<li>Size is at your discretion</li>\n</ul>\n<h4></h4>\n<h4>The Work Involved</h4>\n<h5 style=\"text-align: center;\">Mood Board</h5>\n<img class=\"wp-image-1769 size-large aligncenter\" src=\"http://localhost/wp-content/uploads/2018/01/Craig-Mood-Board-assign-1-1024x655.png\" alt=\"\" width=\"640\" height=\"409\" />\n<h5 style=\"text-align: center;\">Research</h5>\n<img class=\"alignnone size-medium wp-image-1770 aligncenter\" src=\"http://localhost/wp-content/uploads/2018/01/44d0f3058634ec9f3f8131a4a333fdaa-300x264.jpg\" alt=\"\" width=\"300\" height=\"264\" /> <img class=\"alignnone size-medium wp-image-1771 aligncenter\" src=\"http://localhost/wp-content/uploads/2018/01/caught-on-the-fly_5154867b7d084-187x300.png\" alt=\"\" width=\"187\" height=\"300\" /> <img class=\"alignnone size-medium wp-image-1772 aligncenter\" src=\"http://localhost/wp-content/uploads/2018/01/infographic-fishing-poster-template-night-black-colors-icons-flyer-vector-illustration-42988260-246x300.jpg\" alt=\"\" width=\"246\" height=\"300\" /> <img class=\"alignnone size-medium wp-image-1773 aligncenter\" src=\"http://localhost/wp-content/uploads/2018/01/stock-vector-fishing-infographic-elements-set-elements-for-creating-your-own-infographic-design-vector-264470642-281x300.jpg\" alt=\"\" width=\"281\" height=\"300\" />\n<h5 style=\"text-align: center;\">Early Concept</h5>\n<img class=\"wp-image-1774 size-large aligncenter\" src=\"http://localhost/wp-content/uploads/2018/01/Craig-assign-1-infographic-Rough-1024x929.png\" alt=\"\" width=\"640\" height=\"581\" />\n\n&nbsp;\n<h5>Rough Drafts</h5>\n<img class=\"alignnone size-medium wp-image-1777\" src=\"http://localhost/wp-content/uploads/2018/01/Rough2-194x300.png\" alt=\"\" width=\"194\" height=\"300\" /> <img class=\"alignnone size-medium wp-image-1778\" src=\"http://localhost/wp-content/uploads/2018/01/Rough3-246x300.png\" alt=\"\" width=\"246\" height=\"300\" /> <img class=\"alignnone size-medium wp-image-1776\" src=\"http://localhost/wp-content/uploads/2018/01/Rough1-194x300.png\" alt=\"\" width=\"194\" height=\"300\" />\n<h4></h4>\n<h4>About Infographics</h4>\n<h5>When to Use an Infographic</h5>\n<ul>\n 	<li>When detailed explanations are bogging down the text</li>\n 	<li>When space is limited and a small list or graphic may explain more in less space</li>\n 	<li>When a graphical explanation clarifies key concepts</li>\n 	<li>When language or literacy is an issue</li>\n 	<li>When you need to convey complex information quickly</li>\n</ul>\n<h5>Creating Accurate Infographics</h5>\n<ul>\n 	<li>Do your research! Collect data carefully</li>\n 	<li>Edit information carefully. Limited space may lead to fact errors or misleading statements</li>\n 	<li>Convert to standard values. (metric imperial conversions)</li>\n 	<li>Keep it simple. Less is more, and clearer.</li>\n</ul>\n<h5>Creating Good Infographics</h5>\n<ul>\n 	<li>Keep it simple. A single, clear message is easier to comprehend than an image with multiple components</li>\n 	<li>Dress it up. Use graphic elements instead of bars for charts, for example. Position an infographic as you would a photograph</li>\n</ul>', 'Amateur Anglers Details Page', '', 'inherit', 'closed', 'closed', '', '1763-autosave-v1', '', '', '2018-01-24 16:19:30', '2018-01-25 00:19:30', '', 1763, 'http://localhost/2018/01/24/1763-autosave-v1/', 0, 'revision', '', 0),
