(1834, 1, '2018-01-25 16:01:09', '2018-01-26 00:01:09', '<h2>Project Summary</h2>\r\nFrom the list below, create a logotype and package design for a product line that has a family of four items. Your product line should somehow integrate a chosen interpretation of the four elements; Fire, Water, Earth and Air. Research the subject matter. You do not have to interpret the idea literally.\r\n<ul>\r\n 	<li>Personal Product line</li>\r\n 	<li>Gardening line</li>\r\n 	<li>Winery</li>\r\n 	<li>Herb/Spice or Tea or Coffee line</li>\r\n 	<li>Spa or Retreat Product</li>\r\n 	<li>Surfing Product line</li>\r\n</ul>\r\nIt is important to tie them together visually with colour differentiation, pattern, common grid or other common design elements throughout but each of the 4 designs should have it’s own distinctive personality. Consider referencing historical styles, type or colour palette, if relevant. You will research and choose your own packaging but it must be suitable for your product.\r\n\r\n&nbsp;\r\n<h3>The Work Involved</h3>\r\n<p style=\"text-align: left;\"> <a href=\"http://localhost/wp-content/uploads/2018/01/Package-Design-PDF-Handin-Optimized.pdf\" target=\"_blank\" rel=\"noopener\">PowerPoint Research Material</a></p>\r\n<a href=\"http://localhost/wp-content/uploads/2018/01/Design-Brief.docx\" target=\"_blank\" rel=\"noopener\">Design Brief &amp; Notes</a> &amp; Notes', 'Project 2 Details Page', '', 'publish', 'closed', 'closed', '', 'project-2-details-page', '', '', '2018-01-31 16:00:15', '2018-02-01 00:00:15', '', 0, 'http://localhost/?page_id=1834', 0, 'page', '', 0),
(1835, 1, '2018-01-25 16:01:09', '2018-01-26 00:01:09', 'Create a logotype and package design for a product line that has a family of four items. (example 4 types of tea or coffee within a specific brand) Choose from list below. Your product line should somehow integrate a chosen interpretation of the four elements; Fire, Water, Earth and Air. Research the subject matter. You do not have to interpret the idea literally. It is important to tie them together visually with colour differentiation, pattern, common grid or other common design elements throughout but each of the 4 designs should have it’s own distinctive personality. Consider referencing historical styles, type or colour palette, if relevant. You will research and choose your own packaging but it must be suitable for your product. Consider environmentally sound solutions to packaging.', 'Project 2 Details Page', '', 'inherit', 'closed', 'closed', '', '1834-revision-v1', '', '', '2018-01-25 16:01:09', '2018-01-26 00:01:09', '', 1834, 'http://localhost/2018/01/25/1834-revision-v1/', 0, 'revision', '', 0),
(1836, 1, '2018-01-25 16:01:51', '2018-01-26 00:01:51', '<h3>Project Summary</h3>\r\nCreate a logotype and package design for a product line that has a family of four items. (example 4 types of tea or coffee within a specific brand) Choose from list below. Your product line should somehow integrate a chosen interpretation of the four elements; Fire, Water, Earth and Air. Research the subject matter. You do not have to interpret the idea literally. It is important to tie them together visually with colour differentiation, pattern, common grid or other common design elements throughout but each of the 4 designs should have it’s own distinctive personality. Consider referencing historical styles, type or colour palette, if relevant. You will research and choose your own packaging but it must be suitable for your product. Consider environmentally sound solutions to packaging.', 'Project 2 Details Page', '', 'inherit', 'closed', 'closed', '', '1834-revision-v1', '', '', '2018-01-25 16:01:51', '2018-01-26 00:01:51', '', 1834, 'http://localhost/2018/01/25/1834-revision-v1/', 0, 'revision', '', 0),
