(2008, 1, '2018-01-31 15:00:20', '2018-01-31 23:00:20', '<h2>Project Summary</h2>\r\nDesign and create an 8 page + cover brochure as an advertising vehicle for your This is a multi phase project. The identity and packaging you create should inform your style and palette.\r\n\r\nThe brochure should include a description of the company, products and/or services. Decide what you want to use the brochure for—what is its job? Approach the design as it relates to your subject and the target audience. What is your strategy, what is your voice. Do not settle for image - text - image. Use your imagination. The important thing to remember is that you can bring anything you want to the assignment - the possibilities are endless. The brochure is meant to motivate.\r\n\r\n&nbsp;\r\n<h3>The Work Involved</h3>\r\n<a href=\"http://localhost/wp-content/uploads/2018/01/Catalog-Handin-PDF-2.pdf\" target=\"_blank\" rel=\"noopener\">Catalog Work Progress &amp; Research</a>\r\n\r\n&nbsp;', 'Imperious Product Booklet Details', '', 'inherit', 'closed', 'closed', '', '1878-revision-v1', '', '', '2018-01-31 15:00:20', '2018-01-31 23:00:20', '', 1878, 'http://localhost/2018/01/31/1878-revision-v1/', 0, 'revision', '', 0),
